        } catch (e) {
            throw new IllegalCodeError(code);
        }
    // } else if (/^(?=.*\*)(?:\*|)(?:[A-HJ-NPR-Z\d]+(?:\*|)|)$/.test(code)) {   // "*", "A*B", "A*", "*A", "*A*"
    //     return code.replace(/\*/g, '(.+)');
    } else if (/^(?=.*\*)[A-HJ-NPR-Z\d\*]*$/.test(code)) {   // Code with wildcard
