                        variation.choices.forEach(({ pattern }) => {
                            sectionValues.forEach(pv => {
                                try {
                                    validateDecodedValue(pv, pattern);
                                } catch (e) {
                                    this.$errors.add(`${e.message} at ${currentContext}`);
                                }
